const MainTabItems = [
  {
    className : 'nav-item',
    a : {
      className : 'nav-link active',
      datatoggle : 'tab',
      href: '#flights',
      icon : 'fas fa-plane-departure',
      title : 'Flights'
    }
  },
  {
    className : 'nav-item',
    a : {
      className : 'nav-link',
      datatoggle : 'tab',
      href: '#hotels',
      icon : 'fas fa-hotel',
      title : 'Hotels'
    }
  },
  {
    className : 'nav-item',
    a : {
      className : 'nav-link',
      datatoggle : 'tab',
      href: '#car-rental',
      icon : 'fas fa-car',
      title : 'Car Rental'
    }
  }
]

export default MainTabItems;
